import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './FooterNavigation.css';

function FooterNavigation() {
    const menus = [
        {
            navMenu: "Digital Clock",
            navLink: "digital-clock"
        },
        {
            navMenu: "India Covid19 Updates",
            navLink: "Covid"
        },
        {
            navMenu: "International Covid19 Updates",
            navLink: "international-covid-updates"
        },
    ]
    const [active, setActive] = useState(false);
    return (
        <footer className="footerNav">
            <nav class="navbar navbar-expand-lg navbar-light bg-light d-flex justify-content-center">
                <ul class="navbar-nav">
                    {
                        menus.map((e, i) => {
                            return <li class="nav-item" key={i}>
                                <a class="nav-link" onClick activeClassName="active" aria-current="page" href={`/${e.navLink}`}>{e.navMenu}</a>
                                {/* <Link activeClassName="active" to={`/${e.navLink}`}>{e.navMenu}</Link> */}
                            </li>
                        })
                    }
                </ul>
            </nav>
        </footer>
    )
}

export default FooterNavigation;
